const MoaECDSACoreAPI={doGenerate:function(t){return new KJUR.crypto.ECDSA({curve:t}).generateKeyPairHex()},doSign:function(t,r,e,n){const o=new KJUR.crypto.Signature({alg:r});return o.init({d:n,curve:t}),o.updateString(e),o.sign()},doVerify:function(t,r,e,n,o){const i=new KJUR.crypto.Signature({alg:r,prov:"cryptojs/jsrsa"});return i.init({xy:o,curve:t}),i.updateString(e),i.verify(n)}};